from typing import List

def find_duplicates(arr: List[int]) -> List[int]:
    # sort the list
    arr.sort()

    duplicates = []
    count = 0
    last = None

    # iterate through the elements of list
    for num in arr:
        if num == last:
            count += 1
        else:
            if count > 1:
                duplicates.append(last)
            count = 1
        last = num

    # check if the last element was a duplicate
    if count > 1:
        duplicates.append(last)

    return duplicates
